// src/components/Sidebar.tsx
import React from "react";
import styles from "./Sidebar.module.css";

// ✅ Define the set type
interface SetData {
  title: string;
  author: string;
  methods: string;
  setups: number;
  cover: string;
  description: string;
}

// ✅ Define props
interface SidebarProps {
  title: string;
  sets: SetData[];
}

const Sidebar: React.FC<SidebarProps> = ({ title, sets }) => {
  return (
    <div className={styles.sidebar}>
      <p className={styles.title}>{title}</p>
      hr
      <div className={styles.content}>
        {sets.map((set, index) => (
          <div key={index} className={styles.setCard}>
            <h2 className={styles.setTitle}>{set.title}</h2>
            <p className={styles.setDescription}>{set.description}</p>
            <div className={styles.setInfo}>
              <span>Author: {set.author}</span>
              <span>Methods: {set.methods}</span>
              <span>Setups: {set.setups}</span>
              <span>Cover: {set.cover}</span>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Sidebar;
